import React from "react";

class Cart extends React.Component {

  render() {
		console.log(JSON.parse(localStorage.getItem('Products')||'[]'));
		var tab = localStorage.getItem('Products');
		console.log(tab);
	if (tab === null) {
			return
	}

		    return (
      <div class="container">
				{tab.map(product=> (
					<div>
							{product}
					</div>
				))}

      </div>
    );
  }
}
export default Cart;
